import { useParams } from 'react-router-dom';

const Details = () => {
  const { id } = useParams();

  // Access the `id` parameter and use it in your component

  return (
    <div>
      <h1>Details Page</h1>
      <p>ID: {id}</p>
      {/* Rest of your component */}
    </div>
  );
};

export default Details;
